// import styles
import "./style.min.css";

export const Input1 = ({ label, placeholder, value }) => (
  <>
    <p className="input-label">{label}</p>
    <input
      className="input input1"
      placeholder={placeholder}
      type="text"
      value={value}
    />
  </>
);

export const Input2 = ({ label, placeholder, value }) => (
  <>
    <p className="input-label">{label}</p>
    <textarea
      className="input input2"
      placeholder={placeholder}
      type="text"
      value={value}
    />
  </>
);
